values:
update tooooo much.

I just found out.. my lawn is half an acre.. eep. It seems bigger now that I think about it. Haha w00t and I've mowed it lots of time. =D I feel prowed. 25$ mwuahaha

mall tomorrow 5:30-9:30 and i'm taking the bus mwuahahahaha
who else is going?

my dog was trying to kill my brother's hamster. I was laughing.. it was in this ball thing and my dog just pushing it around the hardwood/tiled floors like crazy lmao. poor thing probably going to die of shock. 

I'm in a much better mood than last night. <3

But I'm tired..

I mowed 1/4 of the lawn than I went to refill the mower with gas and it wouldn't start again... sooo I have a break for a bit and than I get to finish the rest of the front.. and than the back over the weekend. w00tness. which means I'll have $25.00 to spend on whatever and $3.20 for bus fair w00t. And no.. I wont spend my money on alcohol. I've promised not to do that during the school year... excluding new years of course... maybe... depends. 

OHH!! Good news. I <i>might</i> be able to convince my parents to let me get my lip or tongue pierced for my birthday... if anything it will be my tongue so I can hide that from my grandmother until I'm 16 heh.. weeeeeeeeeeeee I'm excited...

<sub>I really need to stop updating so much</sub>
